import React, { Component } from 'react'

class Todos extends Component {
    render() {
        // console.log(this.props.todos);
        return (
            <div>
                <h1>Todos</h1>
                <ul>
                    {this.props.todos.map(todo => {
                        <li>{todo}</li>
                    })}
                </ul>
            </div>
        )
    }
}

export default Todos
